INSERT INTO `jiabin_document_git` (`id`, `type`, `pattern`, `describe`)
VALUES
	(1,1,'https://www.baidu.com','下载 git OSX 版'),
	(2,1,'https://www.baidu.com','下载 git Windows 版'),
	(3,1,'https://www.baidu.com','下载 git Linux 版'),
	(4,2,'git init','创建新文件夹，打开，然后执行以创建新的 git 仓库'),
	(5,3,'git clone /path/to/repository','执行如下命令以创建一个本地仓库的克隆版本'),
	(6,3,'git clone username@host:/path/to/repository','如果是远端服务器上的仓库，你的命令会是这个样子。'),
	(9,6,'git push origin master','你的改动现在已经在本地仓库的 HEAD 中了。执行如下命令以将这些改动提交到远端仓库。可以把 master 换成你想要推送的任何分支。'),
	(10,6,'git remote add origin server','如果你还没有克隆现有仓库，并欲将你的仓库连接到某个远程服务器，你可以使用如下命令添加，执行后你就能够将你的改动推送到所添加的服务器上去了。'),
	(11,7,'git checkout -b feature_x','创建一个叫做“feature_x”的分支，并切换过去。'),
	(12,7,'git checkout master','切换回主分支'),
	(13,7,'git branch -d feature_x','再把新建的分支删掉'),
	(14,7,'git push origin branch_name','除非你将分支推送到远端仓库，不然该分支就是 不为他人所见的。'),
	(15,8,'git pull','要更新你的本地仓库至最新改动，执行。'),
	(16,8,'git merge branch_name','以在你的工作目录中 获取（fetch） 并 合并（merge） 远端的改动。要合并其他分支到你的当前分支（例如 master），执行。'),
	(17,8,'git add filename','两种情况下，git 都会尝试去自动合并改动。不幸的是，自动合并并非次次都能成功，并可能导致 冲突（conflicts）。 这时候就需要你修改这些文件来人肉合并这些 冲突（conflicts） 了。改完之后，你需要执行如下命令以将它们标记为合并成功。'),
	(18,8,'git diff source_branch target_branch','在合并改动之前，也可以使用如下命令查看。'),
	(19,9,'git tag 1.0.0 1b2e1d63ff','在软件发布时创建标签，是被推荐的。这是个旧有概念，在 SVN 中也有。可以执行如下命令以创建一个叫做 1.0.0 的标签。'),
	(20,9,'git log','1b2e1d63ff 是你想要标记的提交 ID 的前 10 位字符。使用如下命令获取提交 ID。你也可以用该提交 ID 的少一些的前几位，只要它是唯一的。'),
	(21,10,'git checkout -- filename','假如你做错事（自然，这是不可能的），你可以使用如下命令替换掉本地改动。此命令会使用 HEAD 中的最新内容替换掉你的工作目录中的文件。已添加到缓存区的改动，以及新文件，都不受影响。'),
	(22,10,'git fetch origin','假如你想要丢弃你所有的本地改动与提交，可以到服务器上获取最新的版本并将你本地主分支指向到它。'),
	(23,11,'gitk','内建的图形化 git'),
	(24,11,'git config color.ui true','彩色的 git 输出'),
	(25,11,'git config format.pretty oneline','显示历史记录时，只显示一行注释信息。'),
	(26,11,'git add -i','交互地添加文件至缓存区'),
	(28,4,'git add filename','你可以计划改动（把它们添加到缓存区），添加单文件使用如下命令。'),
	(29,4,'git add *','添加多文件使用如下命令'),
	(30,4,'git commit -m \"代码提交信息\"','这是 git 基本工作流程的第一步；使用如下命令以实际提交改动。执行完后,你的改动已经提交到了 HEAD，但是还没到你的远端仓库。'),
	(31,10,'git reset --hard origin/master','假如你想要丢弃你所有的本地改动与提交，可以到服务器上获取最新的版本并将你本地主分支指向到它。');
INSERT INTO `jiabin_document_regular` (`id`, `type`, `pattern`, `describe`)
VALUES
	(1,1,'\\','将下一个字符标记为一个特殊字符、或一个原义字符、或一个向后引用、或一个八进制转义符。例如，“n”匹配字符“n”。“\\n”匹配一个换行符。串行“\\\\”匹配“\\”而“\\(”则匹配“(”。'),
	(2,1,'^','匹配输入字符串的开始位置。如果设置了RegExp对象的Multiline属性，^也匹配“\\n”或“\\r”之后的位置。'),
	(3,1,'$','匹配输入字符串的结束位置。如果设置了RegExp对象的Multiline属性，$也匹配“\\n”或“\\r”之前的位置。'),
	(4,1,'*','匹配前面的子表达式零次或多次。例如，zo*能匹配“z”以及“zoo”。*等价于{0,}。'),
	(5,1,'+','匹配前面的子表达式一次或多次。例如，“zo+”能匹配“zo”以及“zoo”，但不能匹配“z”。+等价于{1,}。'),
	(6,1,'？','匹配前面的子表达式零次或一次。例如，“do(es)?”可以匹配“does”或“does”中的“do”。?等价于{0,1}。'),
	(7,1,'{n}','n是一个非负整数。匹配确定的n次。例如，“o{2}”不能匹配“Bob”中的“o”，但是能匹配“food”中的两个o。'),
	(8,1,'{n,}','n是一个非负整数。至少匹配n次。例如，“o{2,}”不能匹配“Bob”中的“o”，但能匹配“foooood”中的所有o。“o{1,}”等价于“o+”。“o{0,}”则等价于“o*”。'),
	(9,1,'{n,m}','m和n均为非负整数，其中n<=m。最少匹配n次且最多匹配m次。例如，“o{1,3}”将匹配“fooooood”中的前三个o。“o{0,1}”等价于“o?”。请注意在逗号和两个数之间不能有空格。'),
	(10,1,'?','当该字符紧跟在任何一个其他限制符（*,+,?，{n}，{n,}，{n,m}）后面时，匹配模式是非贪婪的。非贪婪模式尽可能少的匹配所搜索的字符串，而默认的贪婪模式则尽可能多的匹配所搜索的字符串。例如，对于字符串“oooo”，“o+?”将匹配单个“o”，而“o+”将匹配所有“o”。'),
	(11,1,'(pattern)','匹配pattern并获取这一匹配。所获取的匹配可以从产生的Matches集合得到，在VBScript中使用SubMatches集合，在JScript中则使用$0…$9属性。要匹配圆括号字符，请使用“\\(”或“\\)”。'),
	(12,1,'(?:pattern)	','匹配pattern但不获取匹配结果，也就是说这是一个非获取匹配，不进行存储供以后使用。这在使用或字符“(|)”来组合一个模式的各个部分是很有用。例如“industr(?:y|ies)”就是一个比“industry|industries”更简略的表达式。'),
	(13,1,'(?=pattern)','正向肯定预查，在任何匹配pattern的字符串开始处匹配查找字符串。这是一个非获取匹配，也就是说，该匹配不需要获取供以后使用。例如，“Windows(?=95|98|NT|2000)”能匹配“Windows2000”中的“Windows”，但不能匹配“Windows3.1”中的“Windows”。预查不消耗字符，也就是说，在一个匹配发生后，在最后一次匹配之后立即开始下一次匹配的搜索，而不是从包含预查的字符之后开始。\n'),
	(14,1,'(?!pattern)	','正向否定预查，在任何不匹配pattern的字符串开始处匹配查找字符串。这是一个非获取匹配，也就是说，该匹配不需要获取供以后使用。例如“Windows(?!95|98|NT|2000)”能匹配“Windows3.1”中的“Windows”，但不能匹配“Windows2000”中的“Windows”。预查不消耗字符，也就是说，在一个匹配发生后，在最后一次匹配之后立即开始下一次匹配的搜索，而不是从包含预查的字符之后开始'),
	(15,1,'(?<!pattern)','反向否定预查，与正向否定预查类拟，只是方向相反。例如“(?<!95|98|NT|2000)Windows”能匹配“3.1Windows”中的“Windows”，但不能匹配“2000Windows”中的“Windows”。'),
	(16,1,'x|y','匹配x或y。例如，“z|food”能匹配“z”或“food”。“(z|f)ood”则匹配“zood”或“food”。'),
	(17,1,'[xyz]','字符集合。匹配所包含的任意一个字符。例如，“[abc]”可以匹配“plain”中的“a”。'),
	(18,1,'[^xyz]','负值字符集合。匹配未包含的任意字符。例如，“[^abc]”可以匹配“plain”中的“p”。'),
	(19,1,'[a-z]','字符范围。匹配指定范围内的任意字符。例如，“[a-z]”可以匹配“a”到“z”范围内的任意小写字母字符。'),
	(20,1,'[^a-z]','负值字符范围。匹配任何不在指定范围内的任意字符。例如，“[^a-z]”可以匹配任何不在“a”到“z”范围内的任意字符。'),
	(21,1,'\\b','匹配一个单词边界，也就是指单词和空格间的位置。例如，“er\\b”可以匹配“never”中的“er”，但不能匹配“verb”中的“er”。'),
	(22,1,'\\B','匹配非单词边界。“er\\B”能匹配“verb”中的“er”，但不能匹配“never”中的“er”。'),
	(23,1,'\\cx','匹配由x指明的控制字符。例如，\\cM匹配一个Control-M或回车符。x的值必须为A-Z或a-z之一。否则，将c视为一个原义的“c”字符。'),
	(24,1,'\\d','匹配一个数字字符。等价于[0-9]。'),
	(25,1,'\\D','匹配一个非数字字符。等价于[^0-9]。'),
	(26,1,'\\f','匹配一个换页符。等价于\\x0c和\\cL。'),
	(27,1,'\\n','匹配一个换行符。等价于\\x0a和\\cJ。'),
	(28,1,'\\r','匹配一个回车符。等价于\\x0d和\\cM。'),
	(29,1,'\\s','匹配任何空白字符，包括空格、制表符、换页符等等。等价于[\\f\\n\\r\\t\\v]。'),
	(30,1,'\\S','匹配任何非空白字符。等价于[^\\f\\n\\r\\t\\v]。'),
	(31,1,'\\t','匹配一个制表符。等价于\\x09和\\cI。'),
	(32,1,'\\v','匹配一个垂直制表符。等价于\\x0b和\\cK。'),
	(33,1,'\\w','匹配包括下划线的任何单词字符。等价于“[A-Za-z0-9_]”。'),
	(34,1,'\\W','匹配任何非单词字符。等价于“[^A-Za-z0-9_]”。'),
	(35,1,'\\xn','匹配n，其中n为十六进制转义值。十六进制转义值必须为确定的两个数字长。例如，“\\x41”匹配“A”。“\\x041”则等价于“\\x04&1”。正则表达式中可以使用ASCII编码。'),
	(36,1,'\\num','匹配num，其中num是一个正整数。对所获取的匹配的引用。例如，“(.)\\1”匹配两个连续的相同字符。'),
	(37,1,'\\n','标识一个八进制转义值或一个向后引用。如果\\n之前至少n个获取的子表达式，则n为向后引用。否则，如果n为八进制数字（0-7），则n为一个八进制转义值。'),
	(38,1,'\\nm','标识一个八进制转义值或一个向后引用。如果\\nm之前至少有nm个获得子表达式，则nm为向后引用。如果\\nm之前至少有n个获取，则n为一个后跟文字m的向后引用。如果前面的条件都不满足，若n和m均为八进制数字（0-7），则\\nm将匹配八进制转义值nm。'),
	(39,1,'\\nml','如果n为八进制数字（0-3），且m和l均为八进制数字（0-7），则匹配八进制转义值nml。'),
	(40,1,'\\un','匹配n，其中n是一个用四个十六进制数字表示的Unicode字符。例如，\\u00A9匹配版权符号（©）。'),
	(41,2,'/^[a-z0-9_-]{3,16}$/','用户名'),
	(42,2,'/^[a-z0-9_-]{6,18}$/','密码'),
	(43,2,'/^#?([a-f0-9]{6}|[a-f0-9]{3})$/','十六进制值'),
	(44,2,'/^([a-z0-9_\\.-]+)@([\\da-z\\.-]+)\\.([a-z\\.]{2,6})$/\n/^[a-z\\d]+(\\.[a-z\\d]+)*@([\\da-z](-[\\da-z])?)+(\\.{1,2}[a-z]+)+$/','电子邮箱'),
	(45,2,'/^(https?:\\/\\/)?([\\da-z\\.-]+)\\.([a-z\\.]{2,6})([\\/\\w\\.-]*)*\\/?$/','URL'),
	(46,2,'/((2[0-4]\\d|25[0-5]|[01]?\\d\\d?)\\.){3}(2[0-4]\\d|25[0-5]|[01]?\\d\\d?)/ /^(?:(?:25[0-5]|2[0-4][0-9]|[01]?[0-9][0-9]?)\\.){3}(?:25[0-5]|2[0-4][0-9]|[01]?[0-9][0-9]?)$/','IP 地址'),
	(47,2,'/^<([a-z]+)([^<]+)*(?:>(.*)<\\/\\1>|\\s+\\/>)$/','HTML 标签'),
